import React, { Component } from 'react';

const userInput = (props) => {
    const inputStyle = {
        border: '2px solid red'

    }

    return (

        <input type="text"
            style={inputStyle}
            onChange={props.change}
            value={props.currentName}>

        </input>
    )

}

export default userInput;
